import React from 'react';

function App() {
  return (
    <>
      <ul>
        <li>Sum of two no. is {add(40,4)}</li>
        <li>{sub(40,4)}</li>
        <li>{mult(40,4)}</li>
        <li>{div(40,4)}</li>
      </ul>
    </>
  );
}

export default App;
